@ChangelingNix Anyone can write a hello world.
It takes a very brainy person to do it from scratch.

Much like how anyone can assemble furniture, but far fewer can actually turn the raw resources into the final components which are then combined together by the end user.

@MMABrad48 "Hello, him. I mean, her. I mean. Gosh I'm so sorry. Hello 'it'."

Even the world's worst writer wouldn't pass off dialogue like that as realistic.

Pronouns have bugger all to do with real interactions 😅
